import React from 'react';
import "@google/model-viewer"
import "./ModelViewer.css"

class ModelViewer extends React.Component { 
    render() {
        return (
            <div className="ModelViewer">
                <div className="Canvas1" style="ModeViewer.css">
                    <model-viewer ar src="media/3D-files/DSW.gltf" ios-src="media/3D-files/DSWMaterialFinal.usdz" camera-controls poster="media/3D-files/DSW_Poster.png" alt="DSW Chair" background-color="#FFFFFF" auto-rotate ></model-viewer>
                </div>
                <div className="Canvas2">
                    <model-viewer src="media/3D-files/DSW.gltf" ios-src="media/3D-files/DSWMaterialFinal.usdz" camera-controls poster="media/3D-files/DSW_Poster.png" alt="DSW Chair" background-color="#FFFFFF" auto-rotate ></model-viewer>
                </div>
            </div>
        )
    }
}

export default ModelViewer;
